    def var_value(self, var):
        return self.kx[int(var[1:]) - 1] if var[0] == "x" else self.ky[int(var[1:]) - 1]

    ###SIMPLIFY SYSTEM
    def substitute_bits(self, fixed_bits):

        z = self.z

        for i in range(len(z)):

            expr, const = z[i]

            for monomial in expr.copy():
                for var in monomial.copy():
                    if var in fixed_bits:
                        if self.var_value(var): #se la variabile vale 1...
                            if len(monomial) == 1: #se il monomio ha solo quella variabile, allora diventa una costante da sommare al termine noto
                                expr.remove(monomial)
                                const = not const

                            else: #altrimenti elimina semplicemente la variabile dal monomio
                                monomial.remove(var)

                        else: #se la variabile vale 0, rimuovi il monomio
                            expr.remove(monomial)
                            break

            z[i] = (expr, const)

        clean_system(z)

    def find_free_bits(self, verbose = False):
        check = True
        
        while check:
            free_bits = []

            for equation, const in self.z:
                if len(equation) == 1 and len(equation[0]) == 1:
                    var, = equation[0]
                    
                    if var not in free_bits:
                        free_bits.append(var)

            check = free_bits != []

            if check:
                self.substitute_bits(free_bits)

        if verbose:
            print('FREE BIT OTTENUTI:') if len(free_bit) > 0 else print('NESSUN FREE BIT OTTENUTO')

            for var, val in free_bit:
                print(f"{var} -> {int(val)}")

    def substitute_free_bits(self, free_bits):
        for var in free_bits:
            find_first = True
            for i in range(len(self.z)):

                equation, const = self.z[i]
                
                if find_first and {var} in equation:
                    subs_expr = [monomial.copy() for monomial in equation if monomial != {var}]
                    subs_const = f'k{i + 1}'
                    self.z[i] = ([], False)
                    find_first = False
                    continue

                elif not find_first:
                    
                    for monomial in equation.copy():

                        if {var} == monomial:
                            equation.remove(monomial)
                            equation.extend(subs_expr)
                            const.append(subs_const)

                        elif var in monomial:
                            monomial.remove(var)

                            for subs_var in subs_expr:
                                equation.append(monomial.union(subs_var))

                            monomial.add(subs_const)

    ###AUX
    def create_simple_nonlinear_aux(self):

        for equation, _ in self.z:  
            for monomial in equation.copy():   
                if len(monomial) > 1:

                    equation.remove(monomial)

                    if [monomial] in self.aux_system:
                        equation.append(f"a{self.aux_system.index([monomial]) + 1}")
                    else:
                        self.aux_system.append([monomial])
                        equation.append(f"a{len(self.aux_system)}")

