        non_linear_equations = []
        linear_equations = []

        for i in range(len(self.z)):
            if self.z[i][0] != []:
                if is_linear(self.z[i][0]):
                    linear_equations.append(self.z[i])
                else:
                    non_linear_equations.append(equation_to_sat_string(self.z[i], i))

